import React from 'react';
import Log from '../components/Log'
import '../styles/pages/_profil.scss'

const Profil = () => {
    return (
        <div className="profil-page">
            <div className="log-container">
                <Log  inscription={false} connection={true}/>
            </div>
        </div>
    );
};

export default Profil;
